import { useState } from "react";
function Nav() {
    const [checkStatus, setCheckStatus] = useState("");
  const checked = () => {
    return setCheckStatus("checked")
  }
    return (
        <>
            <ul id="myUL">
                {
                    data.map((e) =>
                        <li onClick={() => checked()} className={checkStatus}>{e.name}</li>
                    )
                }
            </ul>
        </>
    )
}
export default Nav;
